If you've taught a yoga class, you've likely had more than a few embarrassing moments. We're human—it happens. 

“Forgetting flows and fumbling words are weekly occurrences,” says Sarah White, who teaches classes in Dubai and leads online creative sequencing trainings. She’s not wrong. Some lapses in memory or judgment simply seem to stand out more than others, whether fashion malfunctions, farts, or flashings.

Click the link in our bio for a (very!) comprehensive list of the most embarrassing things that can happen to yoga teachers!

