@sarahezrinyoga lives with the guilt of “missing her practice” every day, but when June 21st rolls around and the whole world starts talking about International Yoga Day. ⁠
⁠
But yoga needn’t involve squeezing yourself into tight leggings or purchasing a fancy mat. Yoga is an umbrella term for a wide range of contemplative practices, which include meditation, prayer, and even service. For this International Yoga Day, try to broaden your understanding of what it means to do yoga, and we bet you will be surprised by how much yoga you already do.⁠ Link in bio for more!  #yoga #internationalyogaday #yogalife #yogapractice #yogateacher #yogaeverywhere
